def regularExpressionMatching(s, p):
    regex = []
    i = 0
    while i < len(p):
        if i + 1 < len(p) and p[i + 1] == '*':
            regex.append(p[i:i + 2])
            i += 2
        else:
            regex.append(p[i])
            i += 1
    from collections import defaultdict
    dp = defaultdict(list)
    dp[0] = [-1]
    for i, r in enumerate(regex):
        if regex[i] == '.*':
            dp[i + 1] = list(range(min(dp[i]), len(s)))
        elif len(regex[i]) == 2:
            idxs = set(dp[i])
            for idx in dp[i]:
                k = idx + 1
                while s[k] == regex[i][0]:
                    idxs.add(k)
                    k += 1
            dp[i + 1] = list(idxs)
        else:
            for idx in dp[i]:
                if idx + 1 < len(s) and s[idx + 1] == regex[i]:
                    dp[i+1].append(idx + 1)

    return len(s) - 1 in dp[len(regex)]

