def countClouds(skyMap):
    row, col = len(skyMap), len(skyMap[0])

    def dfs(pos):
        i, j = pos[0], pos[1]
        print((i, j))
        if i < 0 or j < 0 or i >= row or j >= col:
            return
        elif (0 <= i and i < row and 0 <= j  and j < col) and skyMap[i][j] != '1':
            return
        skyMap[i][j] = '-'
        vector = [(1, 0), (-1, 0), (0, 1), (0, -1)]
        for v in vector:
            _i, _j = i + v[0], j + v[1]
            dfs((_i, _j))


    count = 0
    for i in range(row):
        for j in range(col):
            if skyMap[i][j] == '1':
                dfs((i, j))
                count += 1

    return count
